import React from "react";
import Carousel from "react-material-ui-carousel";
import { Paper } from "@material-ui/core";

function CarouselComp(props) {
  var items = [
    {
      name: "Aionik",
      description: "Conoce la nueva línea de placas",
      imgsrc:
        "https://res.cloudinary.com/robcg1102/image/upload/v1604355701/maq_img/corrousel_f5ekyy.jpg",
    },
    {
      name: "Random Name #2",
      description: "Hello World!",
      imgsrc:
        "https://res.cloudinary.com/robcg1102/image/upload/v1604431327/maq_img/carousel2_z4nuxk.jpg",
    },
    {
      name: "Random Name #3",
      description: "El tercero",
      imgsrc:
        "https://res.cloudinary.com/robcg1102/image/upload/v1604431327/maq_img/carousel3_hziq2r.jpg",
    },
  ];

  return (
    <Carousel>
      {items.map((item, i) => (
        <Item key={i} item={item} />
      ))}
    </Carousel>
  );
}

function Item(props) {
  return (
    <Paper className="carouselBar">
      <p className="contentCarousel">{props.item.description}</p>
      <img src={props.item.imgsrc} alt={props.item.name} />
    </Paper>
  );
}

export default CarouselComp;
